import styles from '../../../css/Work.module.css';
import Secure from '../../../component/Work/Secure.js';
import flights01 from '../../../public/flights01.png';

class Page extends React.Component {
    constructor(props){
        super(props);
        this.state = {

        }
    }

    render(){
        return(
            <React.Fragment>

                <div className={styles.header}>
                    <Header/>
                    <Grid container>
                        <Grid item xs={5}></Grid>
                        <Grid item xs={2}>
                            <img 
                                src={flights01}
                                className={styles.img01}
                            />
                        </Grid>
                        <Grid item xs={5}></Grid>
                    </Grid>
                </div>

                <div>
                    <Secure/>
                </div>

                <div className={styles.footer}>
                    <Footer/>
                </div>

            </React.Fragment>
        )
    }
}

export default Page;
